import React from 'react';
import { Container, Header } from 'semantic-ui-react';

class Dashboard extends React.Component {
    render() {
        return (
            <Container>
            <Header as="h4">Dashboard</Header>
            </Container>
        )
    }
}

export default Dashboard;
